import axios from "axios";
import { VISUALIZZA_NOTIFICHE } from "./type";

export const ListaNotifiche = () => (dispatch) => {
  axios
    .get("/api/notifiche/notifichelist/")
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: VISUALIZZA_NOTIFICHE,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};
